import React from "react";
import {
  MDBTable,
  MDBTableHead,
  MDBTableBody,
  MDBModal,
  MDBModalDialog,
  MDBModalContent,
  MDBModalHeader,
  MDBModalTitle,
  MDBModalBody,
  MDBModalFooter,
} from "mdbreact";

const DataTable = ({ data = [] }) => {
  const [deleteModal, setDeleteModal] = useState(false);
  const toggleShowDelete = () => setDeleteModal(!deleteModal);

  const handleDelete = async (hashId) => {
    try {
      await deleteHash(hashId);
      setHashData((prev) => prev.filter((hash) => hash.id !== hashId));
    } catch (error) {
      // Handle error (e.g., token expiration or other API issues)
    }
  };

  return data && data.length > 0 ? (
    <>
      <div className="d-flex align-items-center justify-content-center mt-5">
        <MDBTable>
          <MDBTableHead>
            <tr>
              <th>Hash Value</th>
              <th>Description</th>
              <th>Actions</th>
            </tr>
          </MDBTableHead>
          <MDBTableBody>
            {data.map((item) => (
              <tr key={item.id}>
                <td>{item.hash_value}</td>
                <td>{item.description}</td>
                <td>
                  <div className="btn-group" role="group">
                    <button
                      type="button"
                      className="btn btn-secondary"
                      onClick={() => {
                        console.log("hola");
                      }}
                    >
                      Edit
                    </button>
                    <button
                      type="button"
                      className="btn btn-danger"
                      onClick={() => {
                        toggleShowDelete;
                      }}
                    >
                      Delete
                    </button>
                  </div>
                </td>
              </tr>
            ))}
          </MDBTableBody>
        </MDBTable>
      </div>
      <MDBModal show={basicModal} setShow={setBasicModal} tabIndex="-1">
        <MDBModalDialog>
          <MDBModalContent>
            <MDBModalHeader>
              <MDBModalTitle>Modal title</MDBModalTitle>
              <MDBBtn
                className="btn-close"
                color="none"
                onClick={toggleShow}
              ></MDBBtn>
            </MDBModalHeader>
            <MDBModalBody>...</MDBModalBody>

            <MDBModalFooter>
              <MDBBtn color="secondary" onClick={toggleShow}>
                Close
              </MDBBtn>
              <MDBBtn>Save changes</MDBBtn>
            </MDBModalFooter>
          </MDBModalContent>
        </MDBModalDialog>
      </MDBModal>
    </>
  ) : (
    <div className="d-flex align-items-center justify-content-center mt-5">
      <h1>No hashes stored!</h1>
    </div>
  );
};

export default DataTable;
